import PropTypes from 'prop-types';
import Table from '../shared/Table/Table';

const data = [
    {
        key: '1',
        name: 'John',
        address: 'New York',
    },
    {
        key: '2',
        name: 'Jim',
        address: 'London',
    },
    {
        key: '3',
        name: 'David',
        address: 'Sidney',
    },
];

const History = props => {
    return (
        <Table
        // dataSource={data}
        // titles={['Name', 'Address']}
        >
            <Table.Column title={'Name'} dataIndex={'name'} data={data} />
            <Table.Column title={'Address'} dataIndex={'address'} data={data} />
        </Table>
    );
};

History.propTypes = {};

export default History;
